window.bookSummaryJSON = "<p>The emperor has been ousted from the throne, his bloodline is in question, and war is descending on the capital. Forge, the nefarious business coalition that has been manipulating the political situation from the beginning, has the ultimate weapon at its disposal.</p> <p>If it was difficult for a small team of outlaws - or, as Amaranthe has decided they should now be called, rebels - to make a difference before, it's a monumental task now. </p> <p>If she's to return idealistic young Sespian to the throne, earn the exoneration she's sought for so long, and help her closest ally win the respect of the son who detests him, she'll have to employ an unprecedented new scheme, preferably without destroying the city - or herself - in the process.</p>"; 
